import React, { Component } from "react";

class Week extends Component {
  render() {
    return (
      <div class="container">
        <h2>Week</h2>
        <p>The easiest thing to do is post on
        our <a href="http://forum.kirupa.com">forums</a>.
        </p>
      </div>
    );
  }
}

export default Week;
